import React, { Component } from "react";
import Habit from "./habit";

class Habits extends Component {
  state = {
    habits: [
      { name: "Reading", count: 0 },
      { name: "Dancing", count: 0 },
      { name: "Coding", count: 0 },
    ],
  };

  render() {
    return (
      <ul>
        {this.state.habits.map((habit) => (
          <Habit habit={habit} />
        ))}
      </ul>
    );
  }
}

export default Habits;
